import React from "react";
import { Input } from "@/Components/ui/input";
import { Label } from "@/Components/ui/label";
import { Button } from "@/Components/ui/button";
import { useForm } from "@inertiajs/inertia-react";

export default function Login({ message }) {
    const { data, setData, post, processing, setError, errors } = useForm({
        username: "",
        password: "",
    });

    const handleSubmit = (e) => {
        e.preventDefault();
        post("/login", {
            onError: (e) => setError(e),
        });
    };

    return (
        <div className="flex w-screen h-screen justify-center bg-muted items-center">
            <div className="p-8 w-full max-w-lg bg-white rounded-md">
                <div className="mb-8 flex w-full space-x-4">
                    <svg
                        width="48"
                        height="56"
                        viewBox="0 0 96 89"
                        fill="none"
                        xmlns="http://www.w3.org/2000/svg"
                        xmlnsXlink="http://www.w3.org/1999/xlink"
                    >
                        <rect
                            width="96"
                            height="88.9756"
                            fill="url(#pattern0)"
                        />
                        <defs>
                            <pattern
                                id="pattern0"
                                patternContentUnits="objectBoundingBox"
                                width="1"
                                height="1"
                            >
                                <use
                                    xlinkHref="#image0_821_458"
                                    transform="matrix(0.000983895 0 0 0.00106157 -0.000310699 0)"
                                />
                            </pattern>
                            <image
                                id="image0_821_458"
                                width="1017"
                                height="942"
                                xlinkHref="data:image/png;base64,"
                            />
                        </defs>
                    </svg>
                    <div className="flex justify-center flex-col">
                        <h2 className="font-bold text-[28px]">
                            SMK N 1 KASREMAN
                        </h2>
                        <p className="text-sm font-semibold">
                            Sistem Perpustakaan Sekolah untuk melihat daftar dan
                            meminjam.
                        </p>
                    </div>
                </div>
                <h3 className="text-2xl font-semibold mb-0.5 text-center">
                    Selamat Datang
                </h3>
                <p className="text-center">Mohon masukan kredensial anda</p>
                <form action="" onSubmit={handleSubmit}>
                    <div className="my-4">
                        {message && (
                            <div className="mb-2 w-full p-2 text-center rounded-md border border-red-300 text-white bg-red-400">
                                {message}
                            </div>
                        )}
                        <div className="my-2">
                            <Label
                                htmlFor="username"
                                className={`${
                                    errors.username ? "text-destructive" : ""
                                }`}
                            >
                                Username
                            </Label>
                            <Input
                                placeholder="example@username.com"
                                type="text"
                                name="username"
                                id="username"
                                value={data.username}
                                onChange={(e) => {
                                    setData("username", e.target.value);
                                    setError("username", null);
                                }}
                                className={`${
                                    errors.username
                                        ? "border-destructive border text-destructive"
                                        : ""
                                }`}
                            />
                            {errors.username && (
                                <p className="text-destructive text-sm">
                                    {errors.username}
                                </p>
                            )}
                        </div>
                        <div className="my-2">
                            <Label
                                htmlFor="password"
                                className={`${
                                    errors.password ? "text-destructive" : ""
                                }`}
                            >
                                Password
                            </Label>
                            <Input
                                type="password"
                                name="password"
                                id="password"
                                value={data.password}
                                placeholder="password"
                                onChange={(e) => {
                                    setData("password", e.target.value);
                                    setError("password", null);
                                }}
                                className={`w-full ${
                                    errors.password
                                        ? "text-destructive border border-destructive"
                                        : ""
                                }`}
                            />
                            {errors.password && (
                                <p className="text-destructive text-sm">
                                    {errors.password}
                                </p>
                            )}
                        </div>
                    </div>
                    <Button
                        type="submit"
                        disabled={processing}
                        className="w-full"
                    >
                        Masuk
                    </Button>
                </form>
            </div>
        </div>
    );
}
